description:
The library provides
        1. Dynamic JSON manipulator: 
           dynamic jsonObject = JsonMapper.Parse(jsonString);
           ...
           Note: The old interface: JsonObject.Parse(...) is obsoleted. 

        2. JsonMapper, enables to map JSON string to objects fluently and vice versa.
           var employee = JsonMapper.To<Employee>(jsonString);

           // use employee...
           ...

           var jsonString = JsonMapper.ToJson(employee);
           // manipulate JSON...
           ...
           For more information about .NET Commons project, 
           please visit: 
           https://github.com/yanggujun/commonsfornet/wiki/Commons.Json
